import FormularioCliente from "../components/FormularioCliente";

export default function Clientes() {
  return (
    <div className="p-4 max-w-2xl mx-auto">
      <h1 className="text-xl font-bold text-blue-700 mb-4">Alta de Cliente</h1>
      <FormularioCliente />
    </div>
  );
}
